import React, { Component } from 'react';
import './App.css';
import About from './components/about'

class App extends Component {
  render() {
    return (
      <DefaultLayout className="homepage" title="Home">
      <div data-ix="show-signature" id="top" class="hero" style="opacity: 1; transition: opacity 1500ms ease 0s;">
          <h1>Brandon Jernigan</h1>
          <p class="paragraph-4">UX designer</p>
      </div>
      <div>
        <p>
          I&rsquo;m a software engineer, runner, dad, and indie maker currently living
                             in Raleigh, NC.
        </p>
      </div>
      <div>
        <h2>Writing</h2>
          <p>
          This is my personal website. What you see below are a collection of my
          thoughts, insights, and sometimes just public documentation. I&rsquo;ve
          realized that if I try to get my thoughts <b>perfect</b> before hitting publish
          they will never see the light of day. So strap yourself in and read
          the things I was happy to put out into the world, freed from expectations.
          </p>
      </div>
                 </DefaultLayout>
    );
  }
}

export default App;
